import { Label } from "../components/Typography/index";
import styled from "styled-components";
import React from "react";
import { Button } from "../components/Button";

export default () => {
  return <Wrapper></Wrapper>;
};

const SticyNavStyle = {
  display: "flex",
  justifyContent: "space-between",
  position: "fixed" as "fixed",
  padding: "60 60 0",
};

function StickyNav(props: { name: string; role: string; list: object }) {
  const { name, role, list } = props;
  return (
    <nav style={SticyNavStyle}>
      <div>
        <Label color="#111" align="left">
          {name}
        </Label>
        <Label color="#111" align="left">
          {role}
        </Label>
      </div>
      <ul
        style={{
          display: "flex",
          justifyContent: "center",
          alignItems: "center",
        }}
      >
        {list.map((ListItem, index) => {
          return (
            <li key={index}>
              <Button>{ListItem.label}</Button>
            </li>
          );
        })}
      </ul>
    </nav>
  );
}

export const Wrapper = styled.main`
  position: fixed;
  left: 0;
  right: 0;
  bottom: 0;
  top: 0;
  background-color: #fafafa;
`;
